            </jss.TopBar>

            <jss.LayoutContainerJss>
                {children}
            </jss.LayoutContainerJss>

            <jss.Footer>Â© Finance Club</jss.Footer>
        </jss.SiteLayout>
    )
}

export default AppLayout;
